var projectList,nums=8,innerHtmls=function(t){for(var e="",n=Math.ceil(projectList.length/nums)===t?projectList.length:t*nums,s=(t-1)*nums;n>s;s++)e+='<li class="project-item-li"><a target="_blank" class="g-full-block" href="'+htmlEncode(projectList[s].url)+'">',e+="<img src="+htmlEncode(projectList[s].img)+" >",e+='<p class="title">'+htmlEncode(projectList[s].title)+"</p>",e+='<p class="desc g-two-line-txt">'+htmlEncode(projectList[s].desc)+"</p></a></li>";return e},getProjectsList=function(){$.getJSON("mock/projects/projects-504fbd406f.json",function(t){projectList=t.list,document.getElementById("g-list-ul").innerHTML=innerHtmls(1),window.laypage({cont:"g-pagination",pages:Math.ceil(projectList.length/nums),jump:function(t){document.getElementById("g-list-ul").innerHTML=innerHtmls(t.curr)}})})};getProjectsList();